// React
import React, { Fragment } from "react";

// Third part
import { Table, Divider } from "antd";
import { DeleteFilled, EditFilled } from "@ant-design/icons";

// Custom
import "../../assets/css/dish.css";
const { Column } = Table;

const Tables = ({
  data,
  colOne,
  colTwo,
  colThird,
  colFourth,
  colFive,
  deleteItem,
  editItem
}) => {
  return (
    <Table bordered dataSource={data} rowKey={data => data.id}>
      <Column title={colOne} dataIndex={colOne} />
      <Column title={colTwo} dataIndex={colTwo} />
      <Column title={colThird} dataIndex={colThird} />
      <Column title={colFourth} dataIndex={colFourth} />
      <Column
        key={data => data.id}
        title={colFive}
        render={(text, record) => (
          <Fragment>
            <DeleteFilled
              className="bt bt-primary"
              onClick={() => deleteItem(record.id)}
            />

            <Divider type="vertical" />
            <EditFilled
              className="buttonEdit"
              onClick={() => editItem(record)}
            />
          </Fragment>
        )}
      />
    </Table>
  );
};

export default Tables;
